export default {
  name: "Login",
  data() {
    return {
      phone: "",
      password: "",
    };
  },
  methods: {
    // 登录的回调函数
    async UserLogin() {
      try {
        // 登陆成功
        const { phone, password } = this;
        phone &&
          password &&
          (await this.$store.dispatch("UserLogin", { phone, password }));
        // 跳转到home首页(注意还有一种特殊情况:就是未登陆下点击我的订单)
        let toPath=this.$route.query.redirect||'home'
        this.$router.push(toPath);
      } catch (error) {
        alert(error.message);
        this.phone = "";
        this.password = "";
      }
    },
  },
};
